<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Ceramide stabilizes beta-site amyloid precursor protein-cleaving enzyme 1 and promotes amyloid beta-peptide biogenesis . The lipid second messenger ceramide regulates several biochemical events that occur during aging . In addition , its level is highly elevated in the amyloid-burdened brains of Alzheimer ' s disease patients . Here , we analyzed the impact of aberrant ceramide levels on amyloid beta-peptide ( Abeta ) generation by using a cell-permeable analog of ceramide , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - ceramide , and several biochemical inhibitors of the sphingomyelin / glycosphingolipid biosynthetic pathway . We found that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - ceramide increased the biogenesis of Abeta by affecting beta-but not gamma-cleavage of the amyloid precursor protein . Similarly to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - ceramide , increased levels of endogenous ceramide induced by neutral sphingomyelinase treatment also promoted the biogenesis of Abeta . Conversely , fumonisin B1 , which inhibits the biosynthesis of endogenous ceramide , reduced Abeta production . Exogenous 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13671
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 - ceramide restored both intracellular ceramide levels and Abeta generation in fumonisin B1 - treated cells . These events were specific for amyloid precursor protein and were not associated with apoptotic cell death . Pulse-chase and time-course degradation experiments showed that ceramide post-translationally stabilizes the beta-secretase 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) is an atypical antipsychotic drug that has been recently introduced for clinical use in the treatment of schizophrenia . Aripiprazole has a unique pharmacologic profile that includes partial agonism at several G-protein coupled receptors ( GPCRs ) [ especially dopamine ( D2 ) and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ] and antagonistic action at others ( especially 5 - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q13049
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Clinical trials indicate that aripiprazole is effective in treating the positive and negative symptoms of schizophrenia . In short-term studies rapid onset of action ( within one week ) has been demonstrated . Preliminary data indicate that aripiprazole may also be effective in the treatment of manic symptoms of bipolar disorder . At recommended doses , aripiprazole appears to be safe and well tolerated in most adult patients with schizophrenia and schizoaffective disorder . There is only limited information available on the use of aripiprazole in children and adolescents , and pilot data suggest that a revised dosing strategy , based on weight , is indicated in this population . In the long-term studies , the use of aripiprazole was associated with continued efficacy , good compliance and increased time-to-relapse . Aripiprazole represents the first functionally selective atypical antipsychotic drug .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Signalling pathways involved in retinal endothelial cell proliferation induced by advanced glycation end products : inhibitory effect of gliclazide . AIM : We have previously demonstrated that advanced glycation end products ( AGEs ) stimulate bovine retinal endothelial cell ( BREC ) proliferation through induction of vascular endothelial growth factor (

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 expression were assessed by Western blot analysis using specific antibodies . MAPK activity was also determined by an in vitro kinase assay . RESULTS : Treatment of BRECs with AGEs significantly increased cell proliferation and

 effects on cell proliferation and

 , a blocker of DB00171 - sensitive potassium ( K ( DB00171 ) ) channels , can suppress progression of many cancers , but the involved mechanism is unclear . Herein we reported that MGC - 803 cells expressed the K ( DB00171 ) channels composed of Kir 6.2 and

 subunits .

 induced cellular viability decline , coupled with cell apoptosis and reactive oxygen species ( ROS ) generation in MGC - 803 cells . Meanwhile , glibenclamide increased NADPH oxidase catalytic subunit gp91 ( phox ) expression and superoxide anion ( O2 - ) generation , and caused mitochondrial respiration dysfunction in MGC - 803 cells , suggesting that glibenclamide induced an increase of ROS derived from NADPH oxidase and mitochondria .

 - / - or

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Effects of early maternal separation on biobehavioral and neuropathological markers of Alzheimer ' s disease in adult male rats . Stress has been described as a risk factor for the development of Alzheimer ´ s disease ( AD ) . In the present work we aim to study the validity of an experimental model of neonatal chronic stress in order to recapitulate the main hallmarks of AD . Male Wistar rats that were separated daily from the dam during the first 3 weeks of life ( maternal separation , MS ) showed in adulthood cognitive deficits novel object recognition test . In the hippocampus of MS rats , increases in both Aβ40 and Aβ42 levels , the principal constituent of amyloid plaques observed in AD , were accompanied by increased expression of the cleaving enzyme 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P56817

</mark>
 . Hyperphosphorylation of Tau associated to increased activation of the tau kinase 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P45983
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 was also found . Decreased cell number in the hippocampus was observed in stressed rats , as a consequence of both decreased cell proliferation and increased apoptotic death . Decreases in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23560
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and in the synaptic markers synaptophysin and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P78352
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 were also found in MS rats . All these effects could be related to an 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 axis hyperactivity , as reflected in significant increases in corticosterone levels and decreases in glucocorticoid receptor expression . Further , SHSY 5Y neuroblastoma cells treated with corticosterone showed increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , pTau and pJNK 1 expression . In addition , venlafaxine , an antidepressant able to modulate 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 axis activity , reversed all the above cited deleterious effects of chronic stress , both in vivo and in vitro . It is proposed that the MS model can be considered as an appropriate experimental model for the study of sporadic AD .</div>
